import React, { Component }  from 'react';
import  MenuItem from '@material-ui/core/MenuItem';
import MenuList from '@material-ui/core/MenuList';
import {Link} from "react-router-dom";



export default class SideBar extends Component {
    constructor() {
        super();
        this.state = {
            categories: ["Fiction","Children","Comic","Health","Biographies","History","Science"],

        }
    }
    render() {
        return(
             <MenuList>
                <MenuItem>New Arrivals</MenuItem>
                <MenuItem>Bestsellers</MenuItem>
                <MenuItem>Categories</MenuItem>
                <MenuList>
                    {this.state.categories.map(({id,name}) => {
                        console.log(this.state.categories[id]);
                        return <MenuItem className="" key={id}>{name}</MenuItem>
                    })}
                </MenuList>
            </MenuList>

        );
    }
}
